import styled from 'styled-components';

const Card = () => {
  return (
    <CardWrapper>
      <Content>
        <h1>
          Trump adds Ken Starr and Alan Dershowitz to impeachment defense team -
          CNN
        </h1>
      </Content>
      <Image>
        <img
          src="https://www.infodesaku.co.id/wp-content/uploads/2020/01/IMG-20200117-WA0080.jpg"
          alt="news-image"
        />
      </Image>
    </CardWrapper>
  );
};

const CardWrapper = styled.div`
  width: 100%;
  display: flex;
  border: 1px solid #ddd;
  border-radius: 10px;
  cursor: pointer;
`;

const Content = styled.div`
  width: 100%;
  border: 1px solid #ddd;
  border-radius: 10px;
  cursor: pointer;
`;

const Image = styled.div`
  img {
    width: 10%;
  }
`;

export default Card;
